@gcharang thanks, I must say this part isn't much clear from the description in Composer because it mentions only clusters and not Antara. So from the doc I understand Antara is on by default, right? Because  the doc says If N > 0, Antara is enabled and  the Composer choice is between fungible (ac_cc=100 to 9999)  or not fungible (ac_cc=2 to 99).  There's no ac_cc=0 or ac_cc=1  options.
Anyway my question is since Antara is on, does it mean that all currently ready modules are active by default with their rpc? I see 13 modules in the doc, including channels, faucer, dice, etc...
Perhaps I was confused because I expected you had to pick exactly which modules you need.
